import store from './redux/store';
import { Switch } from 'react-router-dom';

function App() {
  return (
    <Provider store = {store}>
      <div className="App">
        <Switch>
          <Home></Home>
        </Switch>
      </div>
    </Provider>
  );
}

export default App;
